                      final info = await http.get("http://www.aduanet.gob.pe/servlet/AIisc?Partida=$partida");

                      //Concexion a la pagina de informacion de ISC
                      if(info.statusCode == 200){

                        fixed = true;

                        var este = parse(info.body);

                        var tablas = este.getElementsByTagName("td");

                        isc = tablas[5].text;
                        var init = tablas[6].text;
                        var fin = tablas[7].text;

                        if(num.parse(fin.substring(6)) < 2019){
                          print("fuck off");
                          print("valor: $isc \ninit: $init \nfin: $fin");
                        }

                      }// fin de coneccion con los detalles de ISC

                    }else{
                      isc = getPct(tables[i+7].text);
                    }//fin de ISC
                    
                    var seguro = getPct(tables[i+17].text);
                    var tasa = getPct(tables[i+19].text);
                      
                    var unidad = tables[i+21].text;

                    productos.add({"tipo": descripcion,"fixed": fixed,"av": av,"isc": isc, "seguro": seguro, "tasa": tasa, "unidad": unidad});

                  }//fin de isProductType

                }//fin de iteracion de los elementos en la tabla de la partida

              }else{//fin de recuperacion de datos de la partida

                print("Request failed with status: ${arancelData.statusCode}.");              

              }

              var r = _otros[i+1].text.trim();
              r = r.replaceAll("\'", "");
              r = r.replaceAll("\"", "");

              Map product = {"nombre": r, "partida": texto, "subcat": "ninguna","productos":productos};

              if(r.contains("-")){
                r = r.replaceAll("-", "");
                r = r.trim();

                subcat = subcat.replaceAll("-", "");
                subcat = subcat.replaceAll(":", "");
                subcat = subcat.trim();

                product["subcat"] = subcat;
                product["nombre"] = r;
              }

              allProductos.add(product);  

              childs.add(product);
                          
              partidas.add(partida);

              counter ++;

              String pct = ((counter/total)*100).toStringAsFixed(2);

              print("$counter out of $total ($pct%)");
              //print(partidas);

            }
            //fin de detecion de partida en la tabla
          }else if((rxSubCategoria.hasMatch(texto) && (texto.length<13)) || texto.isEmpty){
            if(i+1 < _otros.length){
              subcat = _otros[i+1].text.trim();
            }else{
              subcat = "FUCK";
            }
          }
        }//fin de iteracion de miembros de la tabla del capitulo

        var secc = everything.firstWhere((var thing)=>(thing["seccion"] == seccion), orElse: ()=> null);
                
        if(secc != null){
          var cap = secc["capitulos"].firstWhere((var thing)=>(thing["nombre"]== name), orElse: ()=> null);
          if(cap != null){
            cap["children"].addAll(childs);
          }else{
            var cId = capID();
            var sId = secc["id"];
            var cap = {"sid": sId, "id": cId,"nombre": name,"children": childs};

            secc["capitulos"].add(cap);
            capitulos.add(cap);
          }
        }else{
          var cId = capID();
          var sId = secID();

          var cap = {"sid": sId,"id": cId, "nombre": name, "children": childs};

          everything.add({"id": sId,"seccion": seccion, "capitulos":[cap]});

          capitulos.add(cap);
          secciones.add({"id": sId, "seccion": seccion });
        }
      }else{//fin de clasificacion de partidas en el capitulo
        print("Request failed with status: ${pResponse.statusCode}.");              
      }
      
    }//fin de comprobacin de partida

  }//fin de iteracin a todas las partidas

  IOSink data = new File('data.json').openWrite(mode: FileMode.append);

  data.writeln("{");
  writeList(data, secciones, "secciones");
  data.writeln(",");
  writeList(data, allProductos, "allProductos");
  data.writeln(",");
  writeList(data, capitulos, "capitulos");
  data.writeln(",");
  writeList(data, everything, "productos");
  data.writeln("}");

  await data.close();
}

num getPct(String str){
  str = str.trim();
  if(str.contains("%")){
    str = str.replaceAll("%", "");
  }
  return num.tryParse(str)*0.01;
}

String secID()=>"s"+randStr(3);
String capID()=>"c"+randStr(9);

String randStr(int strlen) {
  Random rnd = new Random();
  String result = "";
  for (var i = 0; i < strlen; i++) {
    result += chars[rnd.nextInt(chars.length)];
  }
  return result;
}